function Portfolio(props) {
    
    const student = props;

    console.log(student);

    return ( 
        <>
            <h1>dddd</h1>
            {student.map((post,index)=>(
                <div>{post.name}</div>
            ))}
        </>
    )
}

export default Portfolio
